import React , {Component} from 'react';


export default class Tutorials  extends Component {

 render(){
         return (

            <div className="rtl jumbotron p-4 p-md-5 text-white rounded bg-dark">
            <div className="rtl col-md-6 px-0">
              <h1 className="rtl display-4 font-italic">Title of a longer featured blog post</h1>
              <p className="rtl lead my-3">Multiple lines of text that form the lede, informing new readers quickly and efficiently about what’s most interesting in this post’s contents.</p>
              <p className="rtl lead mb-0"><a href="#" className="rtl text-white font-weight-bold">Continue reading...</a></p>
            </div>
          </div>


            );
        }
    }
